import { Disclosure } from '@headlessui/react'
import { Bars3Icon, XMarkIcon } from '@heroicons/react/24/outline'
import { useNavigate, NavLink } from 'react-router-dom';
import React, { useContext } from "react";
import { UserContext } from "../UserContext";
import axios from 'axios';
import { useEffect, useState } from 'react';


const navigation = [
  { name: 'Home', href: '/', },
  { name: 'About', href: '/About', },
  { name: 'Contact', href: '/Contact', },
]

const log_navigation = [
  { name: 'Login', href: '/login', },
  { name: 'Register', href: '/Register', },

]

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default function Navbar() {

  const nav = useNavigate();

  const { user, login, logout } = useContext(UserContext);
  const [userName, setUserName] = useState('');

  const logout_fun = async () => {
    try {
      await axios.post('http://localhost:3001/logout');
      logout();
      // nav("/")
    } catch (error) {
      console.error(error.message);
    }
  };

  // useEffect(() => {
  //   if (user) {
  //     setUserName(user.email);
  //   } else {
  //     setUserName('');
  //   }
  // }, [user]);


  return (
    <Disclosure as="nav" className="bg-gray-800">
      {({ open }) => (
        <>
          <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
            <div className="relative flex h-16 items-center justify-between">
              <div className="absolute inset-y-0 left-0 flex items-center sm:hidden">
                {/* Mobile menu button*/}
                <Disclosure.Button className="inline-flex items-center justify-center rounded-md p-2 text-gray-400 hover:bg-gray-700 hover:text-white focus:outline-none focus:ring-2 focus:ring-inset focus:ring-white">
                  <span className="sr-only">Open main menu</span>
                  {open ? (
                    <XMarkIcon className="block h-6 w-6" aria-hidden="true" />
                  ) : (
                    <Bars3Icon className="block h-6 w-6" aria-hidden="true" />
                  )}
                </Disclosure.Button>
              </div>
              <div className="flex flex-1 items-center justify-center sm:items-stretch sm:justify-start">
                <div className="flex flex-shrink-0 items-center">
                  <img
                    className="block h-8 w-auto lg:hidden"
                    src="https://tailwindui.com/img/logos/mark.svg?color=indigo&shade=500"
                    alt="Your Company"
                  />
                  <img
                    className="hidden h-8 w-auto lg:block"
                    src="https://tailwindui.com/img/logos/mark.svg?color=indigo&shade=500"
                    alt="Your Company"
                  />
                </div>
                <div className="hidden sm:ml-6 sm:block ">
                  <div className="flex space-x-4">
                    {navigation.map((item) => (
                      <NavLink
                        key={item.name}
                        to="/Profile"
                        className={({ isActive }) => {
                          return (
                            'px-3 py-2 rounded-md text-ml font-medium no-underline' +
                            (isActive ? 'text-gray-300 bg-gray-700 text-white'
                              : 'bg-gray-800 text-white')
                          );
                        }}

                      >
                        {item.name}
                      </NavLink>
                    ))}
                  </div>
                </div>


              </div>
              {user ? (
                <div className="absolute inset-y-0 right-0 flex items-center pr-2 sm:static sm:inset-auto sm:ml-6 sm:pr-0">
                   <button
                      class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded ml-3">

                      {user.email}

                    </button>
                  <button
                    class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded ml-3">

                   
                    <NavLink

                      onClick={logout_fun}
                    >Logout
                    </NavLink>
                  </button>






                </div>
              ) : (
                <div className="absolute inset-y-0 right-0 flex items-center pr-2 sm:static sm:inset-auto sm:ml-6 sm:pr-0">
                  <button
                    class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded ml-3">

                    <NavLink
                      key={"Login"}
                      to={"/Login"}
                    >Login
                    </NavLink>
                  </button>

                  <button
                    class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded ml-3">

                    <NavLink
                      key={"Register"}
                      to={"/Register"}
                    >
                      Register
                    </NavLink>
                  </button>

                </div>)}
            </div>
          </div>

          <Disclosure.Panel className="sm:hidden">
            <div className="space-y-1 px-2 pt-2 pb-3">
              {navigation.map((item) => (
                <Disclosure.Button
                  key={item.name}
                  as="a"
                  href={item.href}
                  className={classNames(
                    item.current ? 'bg-gray-900 text-white' : 'text-gray-300 hover:bg-gray-700 hover:text-white',
                    'block rounded-md px-3 py-2 text-base font-medium'
                  )}
                  aria-current={item.current ? 'page' : undefined}
                >
                  {item.name}
                </Disclosure.Button>
              ))}
            </div>
          </Disclosure.Panel>
        </>
      )}
    </Disclosure>
  )
}
